  false,\n\t\"url\": null,\n\t\"notes\": \"In late 1996, the Dept of Conservation
  (DOC) surveyed state and federal agencies about the county boundary coverage they
  used. As a result, DOC adopted the 1:24,000 (24K) scale U.S. Bureau of Reclamation
  (USBR) data set (USGS source) for their Farmland Mapping and Monitoring Program
  (FMMP) but with several modifications. Detailed documentation of these changes is
  provided by FMMP and included in the Process Step section of the Feature Class metadata.
  A data set named cnty24k97_1 was made available (approximately 2004) through the
  California Department of Forestry and Fire Protection - Fire and Resource Assessment
  Program (CDF - FRAP) and the California Spatial Information Library (CaSIL). In
  late 2006, the Department of Fish and Game (DFG) reviewed cnty24k97_1. Comparisons
  were made to a high-quality 100K dataset (co100a/county100k from the former Teale
  Data Center GIS Solutions Group) and legal boundary descriptions from ( http://www.leginfo.ca.gov
  ). The cnty24k97_1 data set was missing Anacapa and Santa Barbara islands. DFG added
  the missing islands using previously-digitized coastline data (coastn27 of State
  Lands Commission origin), corrected a few county boundaries, built region topology,
  added additional attributes, and renamed the data set to county24k. In 2007, the
  California Mapping Coordinating Committee (CMCC) requested that the California Department
  of Forestry and Fire Protection (CAL FIRE) resume stewardship of the statewide county
  boundaries data. CAL FIRE adopted the changes made by DFG and collected additional
  suggestions for the county data from DFG, DOC, and local government agencies. CAL
  FIRE incorporated these suggestions into the latest revision, which has been renamed
  cnty24k09_1. Detailed documentation of changes is included in the Process Step section
  of the Feature Class metadata. This Geo database contains 3 feature classes representing
  California county boundaries (arc, polygon, and multipart-polygon feature classes)
  and also contains a polygon feature class representing the state boundary: 1. Line
  - can be useful for cartographic purposes, especially when different line symbology
  is needed for different boundaries (e.g. Coastline, Mexico, Nevada, etc). 2. Multipart
  - features from a common county are combined into a single record (equivalent to
  a region feature class in a coverage). May be useful for selections and overlays
  when all parts of a county are needed. 3. Poly - all county features are represented
  as individual polygons. 4. State Poly - state boundary polygon to be used for cartography
  or overlay analysis that requires a state polygon.\",\n\t\"owner_org\": \"467d900f-8a42-452d-9906-6610dd1a767f\",\n\t\"extras\":
